import SteelSwordImg from './steel-sword.png';

const SteelSword = {
  name: 'Steel Sword',
  type: 'weapon',
  kind: 'melee',
  effect: {},
  range: 1,
  damage: '1d8 + 4',
  image: SteelSwordImg,
  value: 35,
};

export default SteelSword;
